import React from 'react'
import './Card.css'
import { motion } from "framer-motion"


export default function Contact() {
    return (
        <motion.div
            style={pageStyle}
            initial="initial"
            animate="in"
            exit="out"
            variants={pageVariants}
            transition={pageTransition}
            className="Card"
        >
            <div>
                ESTO ES EL CONTACT 
            </div>
        </motion.div>
    );
  }
